import * as React from 'react';
import Button from '@mui/material/Button';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';
import Slide from '@mui/material/Slide';
import { useSelector } from 'react-redux';

const Transition = React.forwardRef(function Transition(props, ref) {
    return <Slide direction="up" ref={ref} {...props} />;
});

export const LendMessage = ({idCar, idLend, setShowMy, setShowFather}) => {

    let car = useSelector(x => x.Cars).find(c => c.id == idCar)

    return (
        <>
            <Dialog open={true} TransitionComponent={Transition} keepMounted >
                <DialogTitle id="carDetailes">{"ההזמנה נקלטה בהצלחה"}</DialogTitle>
                <DialogContent>
                    <br></br>
                    <DialogContentText> הרכב מחכה לך במיקום:  <label className='dialogText'>{car.street} {car.city} </label></DialogContentText>
                    <DialogContentText><label className='dialogValue'>מספר הזמנה: </label><label className='dialogText'>{idLend} </label></DialogContentText>
                </DialogContent>
                <DialogActions>
                    <Button onClick={()=>{setShowMy(false); setShowFather(false)}}>אישור</Button>
                </DialogActions>
            </Dialog>
        </>
    );
}
